import React, { useState } from "react";
import "./Chat.css";

function SettingsTraining() {
  const [message, setMessage] = useState("");
  const [response, setResponse] = useState("");
  const [messages, setMessages] = useState([]);
  const [loading, setLoading] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    setLoading(true);
    fetch(`${process.env.REACT_APP_BACKEND_URL}/parentapproute`, {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({ message }),
    })
      .then((res) => res.json())
      .then((data) => {
        setResponse(data.message);
        setMessages((prev) => [
          ...prev,
          { type: "user", content: message },
          { type: "bot", content: data.message },
        ]);
        setMessage("");
        setLoading(false);
      });
  };

  const formatBotMessage = (content) => {
    const lines = content.split("\n");
    let listItems = [];
    const elements = [];

    lines.forEach((line, index) => {
      const match = line.match(/^(\d+)\.\s(.*)$/);

      if (match) {
        const [, , text] = match;
        listItems.push(<li key={`li-${index}`}>{text}</li>);
      } else {
        if (listItems.length > 0) {
          elements.push(<ul key={`ul-${elements.length}`}>{listItems}</ul>);
          listItems = [];
        }
        elements.push(<p key={`p-${index}`}>{line}</p>);
      }
    });

    if (listItems.length > 0) {
      elements.push(<ul key={`ul-${elements.length}`}>{listItems}</ul>);
    }

    return <div>{elements}</div>;
  };

  return (
    <div className="chat-container">
      <nav className="navbar">
        <div className="nav-tabs">
          <a href="/" className="nav-tab">
            Home
          </a>
          <a href="/login" className="nav-tab">
            Login
          </a>
          <a href="/parent" className="nav-tab">
            Parent App
          </a>
          <a href="/settings" className="nav-tab">
            Settings Training
          </a>
        </div>
        <a href="/" className="logo">
          <img
            src="https://rollcall.com.au/wp-content/uploads/2018/08/cropped-RollCall-logo-sml-02.png"
            alt="Your Logo"
            style={{ width: "100px" }}
          />
        </a>
      </nav>
      <div className="chat-window">
        {messages.map((msg, i) => (
          <div
            key={i}
            className={`message-wrapper ${
              msg.type === "user"
                ? "user-message-wrapper"
                : "bot-message-wrapper"
            }`}
          >
            <div
              className={`${msg.type === "user" ? "user-name" : "bot-name"}`}
            >
              {msg.type === "user" ? "John" : "Ange"}
            </div>
            <div
              className={`message ${
                msg.type === "user" ? "user-message" : "bot-message"
              }`}
            >
              {msg.type === "bot" ? formatBotMessage(msg.content) : msg.content}
            </div>
          </div>
        ))}
      </div>
      <form onSubmit={handleSubmit} className="form-container">
        <textarea
          value={message}
          onChange={(e) => setMessage(e.target.value)}
          className="message-input"
          placeholder="Type your message..."
        ></textarea>
        <button type="submit" className="submit-button" disabled={loading}>
          {loading ? <div className="loader"></div> : "Send"}
        </button>
        {loading && <div className="typing-bubble">Ange is typing...</div>}
      </form>
    </div>
  );
}

export default SettingsTraining;
